import React, { useEffect, useState } from 'react';
import nflScheduleData from '../scraping/nfl_schedule.json'; // Import the JSON file

const Content = ({ activeTab }) => {
  const [scheduleData, setScheduleData] = useState([]);

  useEffect(() => {
    // Use the imported JSON data directly
    setScheduleData(nflScheduleData);
  }, [activeTab]);

  if (activeTab === 'NFL') {
    return (
      <div className="nfl-schedule">
        <table>
          <thead>
            <tr>
              <th>Week</th>
              <th>Day</th>
              <th>Date</th>
              <th>Time</th>
              <th>Winner/tie</th>
              <th>Loser/tie</th>
            </tr>
          </thead>
          <tbody>
            {scheduleData.map((game, index) => (
              <tr key={index}>
                <td>{game.Week}</td>
                <td>{game.Day}</td>
                <td>{game.Date}</td>
                <td>{game.Time}</td>
                <td>{game.TeamNames1}</td>
                <td>{game.TeamNames2}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }

  return null;
};

export default Content;
